import axios from 'axios';

const baseUrl = "http://localhost:8000/api/v1";

// Start LoginForm
export const login = ({ email, password }) => axios({
  method: 'post',
  url: `${baseUrl}/login`,
  data: {
    email,
    password,
  },
});

export const signup = ({ username, email, password }) => axios({
  method: 'post',
  url: `${baseUrl}/signup`,
  data: {
    username,
    email,
    password,
  },
});
